drop database if exists vds;

create database vds  CHARACTER SET latin1  COLLATE latin1_swedish_ci;

use vds;

SET default_storage_engine=InnoDb;

SET FOREIGN_KEY_CHECKS=0;

DROP TABLE IF EXISTS administrateur;
CREATE TABLE IF NOT EXISTS administrateur (
  id int NOT NULL,
  PRIMARY KEY (id)
);


DROP TABLE IF EXISTS categorie;
CREATE TABLE IF NOT EXISTS categorie (
  id varchar(3) NOT NULL,
  nom varchar(20) NOT NULL,
  agemin tinyint NOT NULL,
  agemax tinyint NOT NULL,
  distanceMax varchar(50) NOT NULL DEFAULT 'Illimitée',
  PRIMARY KEY (id),
  UNIQUE KEY nom (nom),
  UNIQUE KEY agemin (agemin),
  UNIQUE KEY agemax (agemax)
);


DROP TABLE IF EXISTS classement;
CREATE TABLE IF NOT EXISTS classement (
  id smallint NOT NULL AUTO_INCREMENT,
  date date NOT NULL,
  nom varchar(50) NOT NULL,
  distance varchar(22) NOT NULL,
  nbParticipant smallint NOT NULL,
  PRIMARY KEY (id)
);


DROP TABLE IF EXISTS coureur;
CREATE TABLE IF NOT EXISTS coureur (
  id int NOT NULL AUTO_INCREMENT,
  nom varchar(50) NOT NULL,
  prenom varchar(50) NOT NULL,
  annee char(4) DEFAULT NULL,
  sexe char(1) NOT NULL,
  PRIMARY KEY (id)
) ;


DROP TABLE IF EXISTS course;
CREATE TABLE IF NOT EXISTS course (
  id int NOT NULL AUTO_INCREMENT,
  date date NOT NULL,
  saison enum('PRINTEMPS','ETE','AUTOMNE','HIVER') NOT NULL,
  distance varchar(5) NOT NULL,
  nbParticipant int NOT NULL DEFAULT '0',
  PRIMARY KEY (id)
);


DROP TABLE IF EXISTS document;
CREATE TABLE IF NOT EXISTS document (
  id int NOT NULL AUTO_INCREMENT,
  titre varchar(150) NOT NULL,
  idType smallint NOT NULL,
  dateCreation date NOT NULL,
  PRIMARY KEY (id),
  KEY idType (idType)
);


DROP TABLE IF EXISTS droit;
CREATE TABLE IF NOT EXISTS droit (
  idAdministrateur int NOT NULL,
  idFonction int NOT NULL,
  PRIMARY KEY (idAdministrateur,idFonction),
  KEY idFonction (idFonction)
);


DROP TABLE IF EXISTS epreuve;
CREATE TABLE IF NOT EXISTS epreuve (
  id int NOT NULL AUTO_INCREMENT,
  nom varchar(100) NOT NULL,
  description text,
  date date NOT NULL,
  PRIMARY KEY (id),
  UNIQUE KEY date (date)
);


DROP TABLE IF EXISTS fonction;
CREATE TABLE IF NOT EXISTS fonction (
  id int NOT NULL AUTO_INCREMENT,
  nom varchar(100) NOT NULL,
  fichier varchar(60) NOT NULL,
  menu enum('Ajouter','Gérer') NOT NULL DEFAULT 'Gérer',
  description varchar(150) NOT NULL,
  PRIMARY KEY (id)
);


DROP TABLE IF EXISTS information;
CREATE TABLE IF NOT EXISTS information (
  id int NOT NULL AUTO_INCREMENT,
  titre varchar(70) NOT NULL,
  contenu mediumtext NOT NULL,
  auteur varchar(50) NOT NULL,
  idType smallint NOT NULL,
  dateCreation date NOT NULL,
  PRIMARY KEY (id),
  KEY idType (idType)
);


DROP TABLE IF EXISTS lien;
CREATE TABLE IF NOT EXISTS lien (
  id int NOT NULL AUTO_INCREMENT,
  nom varchar(50) NOT NULL,
  description varchar(500) DEFAULT NULL,
  url varchar(150) NOT NULL,
  rang int NOT NULL DEFAULT '1',
  logo varchar(70) DEFAULT NULL,
  PRIMARY KEY (id),
  UNIQUE KEY nom (nom)
);


DROP TABLE IF EXISTS lienffa;
CREATE TABLE IF NOT EXISTS lienffa (
  id int NOT NULL AUTO_INCREMENT,
  titre varchar(200) NOT NULL,
  url varchar(350) NOT NULL,
  PRIMARY KEY (id)
);


DROP TABLE IF EXISTS membre;
CREATE TABLE IF NOT EXISTS membre (
  id int NOT NULL AUTO_INCREMENT,
  nom varchar(30) NOT NULL,
  prenom varchar(50) NOT NULL,
  montantLicence int DEFAULT NULL,
  email varchar(100) NOT NULL,
  fixe varchar(10) DEFAULT NULL,
  mobile varchar(10) DEFAULT NULL,
  password varchar(15) NOT NULL DEFAULT '1111',
  photo varchar(50) DEFAULT NULL,
  abtInformation tinyint NOT NULL DEFAULT '0',
  autMail tinyint NOT NULL DEFAULT '0',
  saison int NOT NULL,
  login varchar(50) NOT NULL,
  nbConnexion int NOT NULL DEFAULT '0',
  PRIMARY KEY (id),
  UNIQUE KEY login (login)
);


DROP TABLE IF EXISTS message;
CREATE TABLE IF NOT EXISTS message (
  id int NOT NULL AUTO_INCREMENT,
  nomPrenom varchar(70) NOT NULL,
  email varchar(100) NOT NULL,
  message text NOT NULL,
  dateReponse datetime DEFAULT NULL,
  auteur varchar(50) DEFAULT NULL,
  reponse text,
  dateCreation datetime NOT NULL,
  PRIMARY KEY (id)
);


DROP TABLE IF EXISTS page;
CREATE TABLE IF NOT EXISTS page (
  id int NOT NULL,
  nom varchar(30) NOT NULL,
  contenu text NOT NULL,
  PRIMARY KEY (id)
)   ;


DROP TABLE IF EXISTS parametre;
CREATE TABLE IF NOT EXISTS parametre (
  saison int NOT NULL,
  debutSaison date NOT NULL,
  finSaison date NOT NULL,
  emailContact varchar(50) NOT NULL,
  nomAssociation varchar(50) NOT NULL,
  nomPresident varchar(50) NOT NULL,
  siege varchar(100) DEFAULT NULL,
  rue varchar(100) NOT NULL,
  ville varchar(50) NOT NULL,
  debutAdhesion date DEFAULT NULL,
  finAdhesion date DEFAULT NULL,
  moisFfa int NOT NULL DEFAULT '11',
  code char(64) NOT NULL,
  url varchar(80) NOT NULL DEFAULT 'localhost/site/vds',
  emailWebmaster varchar(80) DEFAULT 'guy.verghote@free.fr',
  emailPresident varchar(80) DEFAULT 'guy.verghote@laposte.net',
  PRIMARY KEY (saison)
)   ;


DROP TABLE IF EXISTS partenaire;
CREATE TABLE IF NOT EXISTS partenaire (
  id smallint NOT NULL AUTO_INCREMENT,
  nom varchar(100) NOT NULL,
  domaine smallint NOT NULL DEFAULT '1',
  logo varchar(40) DEFAULT NULL,
  PRIMARY KEY (id)
);


DROP TABLE IF EXISTS reportage;
CREATE TABLE IF NOT EXISTS reportage (
  id int NOT NULL,
  date date NOT NULL,
  titre varchar(200) NOT NULL,
  url varchar(150) NOT NULL,
  PRIMARY KEY (id)
)   ;


DROP TABLE IF EXISTS reportagevideo;
CREATE TABLE IF NOT EXISTS reportagevideo (
  id int NOT NULL AUTO_INCREMENT,
  idCourse int NOT NULL,
  url varchar(50) NOT NULL,
  niveau enum('As','Populaire') DEFAULT NULL,
  PRIMARY KEY (id),
  KEY idCourse (idCourse)
);

DROP TRIGGER IF EXISTS avantAjoutReportageVideo;
DELIMITER $$
CREATE TRIGGER avantAjoutReportageVideo BEFORE INSERT ON reportagevideo FOR EACH ROW if (select 0 from reportagevideo where url = new.url) then
		SIGNAL sqlstate '45000' set message_text = '#Cette url est déjà associée à un reportage';
	end if
$$
DELIMITER ;
DROP TRIGGER IF EXISTS avantModificationReportageVideo;
DELIMITER $$
CREATE TRIGGER avantModificationReportageVideo BEFORE UPDATE ON reportagevideo FOR EACH ROW if (select 1 from reportagevideo where url = new.url and id != new.id) then
		SIGNAL sqlstate '45000' set message_text = '#Cette url est déja associée à un autre reportage';
	end if
$$
DELIMITER ;

DROP TABLE IF EXISTS resultat;
CREATE TABLE IF NOT EXISTS resultat (
  idCourse int NOT NULL,
  place int NOT NULL,
  idCoureur int NOT NULL,
  categorie varchar(3) NOT NULL,
  placeCategorie int NOT NULL,
  temps time NOT NULL,
  club varchar(75) DEFAULT NULL,
  PRIMARY KEY (idCourse,place),
  KEY idCoureur (idCoureur)
);


DROP TABLE IF EXISTS type;
CREATE TABLE IF NOT EXISTS type (
  id smallint NOT NULL,
  nom varchar(15) NOT NULL,
  PRIMARY KEY (id)
);



ALTER TABLE administrateur
  ADD CONSTRAINT administrateur_ibfk_1 FOREIGN KEY (id) REFERENCES membre (id) ON DELETE CASCADE ON UPDATE CASCADE;

ALTER TABLE document
  ADD CONSTRAINT document_ibfk_1 FOREIGN KEY (idType) REFERENCES type (id);

ALTER TABLE droit
  ADD CONSTRAINT droit_ibfk_1 FOREIGN KEY (idAdministrateur) REFERENCES administrateur (id) ON DELETE CASCADE ON UPDATE CASCADE,
  ADD CONSTRAINT droit_ibfk_2 FOREIGN KEY (idFonction) REFERENCES fonction (id) ON DELETE CASCADE ON UPDATE CASCADE;

ALTER TABLE information
  ADD CONSTRAINT information_ibfk_1 FOREIGN KEY (idType) REFERENCES type (id);

ALTER TABLE reportagevideo
  ADD CONSTRAINT reportagevideo_ibfk_1 FOREIGN KEY (idCourse) REFERENCES course (id);

ALTER TABLE resultat
  ADD CONSTRAINT resultat_ibfk_1 FOREIGN KEY (idCoureur) REFERENCES coureur (id),
  ADD CONSTRAINT resultat_ibfk_2 FOREIGN KEY (idCourse) REFERENCES course (id);
SET FOREIGN_KEY_CHECKS=1;



